import { NavLink } from "react-router-dom";

const Nav = () => {
  return (
    <>
      <nav
        style={{
          border: "5px solid",
          position: "fixed",
          color: "white",
          height: "500px",
          width: "500px",
          padding: "75px",
          display: "flex",
          flexDirection: "column",
          justifyContent: "space-evenly",
        }}
      >
        <NavLink
          key="hero"
          to="/"
          style={({ isActive }) => {
            return {
              color: isActive ? "gold" : "#108c43",
              textDecoration: "none",
              fontSize: "40px",
            };
          }}
        >
          Tristan D'Amours
        </NavLink>
        <NavLink
          key="about"
          to="/about"
          style={({ isActive }) => {
            return {
              color: isActive ? "gold" : "skyblue",
              textDecoration: "none",
              fontSize: "35px",
            };
          }}
        >
          About{" "}
        </NavLink>
        <NavLink
          key="publishedWork"
          to="/publishedwork"
          style={({ isActive }) => {
            return {
              color: isActive ? "gold" : "skyblue",
              textDecoration: "none",
              fontSize: "35px",
            };
          }}
        >
          Published Work{" "}
        </NavLink>
        <NavLink
          key="contact"
          to="/contact"
          style={({ isActive }) => {
            return {
              color: isActive ? "gold" : "skyblue",
              textDecoration: "none",
              fontSize: "35px",
            };
          }}
        >
          Contact{" "}
        </NavLink>
      </nav>
    </>
  );
};

export default Nav;
